  {title: "BugSplat (traditional animation)", description: "<p>Hey, Dribbblers!</p>\n\n<p>We are currently working on a project for <a href=\"http://www.bugsplatsoftware.com/\" rel=\"nofollow noreferrer\">BugSplat</a>, which is a cross-platform crash reporting for softwares. These folks are serious and will not let bugs get away with their nasty behaviour! X-ray and a juicy bug smash are included in the service</p>\n\n<p>This time we came back to basics are a bit old-school and made a very classical animation, as each shot was separately hand-drawn...and yes, it's my Tetris!)</p>\n\n<p>Follow us on <a href=\"https://twitter.com/fireart_studio\" rel=\"nofollow noreferrer\">Twitter</a> &amp; <a href=\"https://www.facebook.com/fireartd\" rel=\"nofollow noreferrer\">Facebook</a> &amp; <a href=\"https://www.instagram.com/fireart_studio/\" rel=\"nofollow noreferrer\">Instagram</a></p>", width: "400", height: "300", tags: "[\"animation\", \"bug\", \"character\", \"fireart\", \"fireart studio\", \"gartman\", \"kill\", \"pencil\", \"process\", \"sketch\", \"team\"]", image_url: nil, image_path: nil, user_id: 5, viewcount: 1096, likes_count: 155, comments_count: 4, attachments_count: 0, rebounds_count: 0, buckets_count: 4, dribbble_id: 2739786, html_url: "https://dribbble.com/shots/2739786-BugSplat-traditional-animation", attachments_url: nil, buckets_url: "https://api.dribbble.com/v1/shots/2739786/buckets", comments_url: "https://api.dribbble.com/v1/shots/2739786/comments", likes_url: "https://api.dribbble.com/v1/shots/2739786/likes", projects_url: "https://api.dribbble.com/v1/shots/2739786/projects", animated: true, user_name: nil, user_username: nil, user_html_url: nil, user_avatar_url: nil, user_bio: nil, user_location: nil, comments_received_count: nil, followers_count: nil, followings_count: nil, likes_received_count: nil, projects_count: nil, rebounds_received_count: nil, shots_count: nil, teams_count: nil, can_upload_shot: nil, dribbble_type: nil, pro: nil, followers_